revised_title: A Case Study of a Woman Who Voided Fetal Bones Above the Pubis
scientific_discipline: Medicine & Health Sciences
scientific_subdiscipline: Obstetrics & Gynecology
tldr: A woman named Margaret Parry experienced unusual postpartum symptoms, including
  the expulsion of fetal bones above the pubis and through her menstrual cycle. The
  case study details her medical history, treatment, and recovery, highlighting the
  rarity of such occurrences.
